import React from "react";
import Introduction from "../components/introduction";
import './SolarChecker.css';
import Result from "../components/result";

export default function SolarChecker(props) {

  console.log(props.state);

  let pageToDisplay = props.state.inputData.page;

  return (
    <div>
      {pageToDisplay === 1 && <Introduction version={props.version} />}
      {pageToDisplay === 2 && <Result version={props.version} />}
      <footer>
        <p>&copy; 2024 Rishabh Goel. All rights reserved. V1.1</p>
      </footer>
    </div>

  );
}
